import React from "react";
import logosize from './images/DownloadApp.jpg';

import { useHistory } from "react-router-dom";

import {
  BrowserRouter as Router,
  Route,
  Switch,
  Link,
  withRouter,
  Redirect
} from "react-router-dom";

import {
    BoxFooter,
    ContainerFooter,
    RowFooter,
    ColumnFooter,
    HeadingFooter
  } from "./FooterStyles";


function Footer() {
  return (
    <BoxHeader>
    <div><ImgagingHeader src={logosize} alt="logo" /></div>
    <ContainerHeader>
    <RowHeader>
      <ColumnHeader>
        <HeadingHeader href="/">Home</HeadingHeader>
      </ColumnHeader>
      <ColumnHeader>
        <HeadingHeader href="/About">About Us</HeadingHeader>
      </ColumnHeader>
      <ColumnHeader>
        <HeadingHeader href="/Service">Services</HeadingHeader>
      </ColumnHeader>
      <ColumnHeader>
        <HeadingHeader href="/Contact">Contact Us</HeadingHeader>
      </ColumnHeader>
      <ColumnHeader><StartButtonHeader>LET's GET STARTED</StartButtonHeader></ColumnHeader>
    </RowHeader>
  </ContainerHeader>
  /BoxFooter</BoxHeader>
  );
}

export default Footer;
